count = 0
primes = {2, 3, 5, 7}
for num in range(10000, 100000):
    s = str(num)
    # check all digits distinct
    if len(set(s)) != 5:
        continue
    A, B, C, D, E = map(int, s)
    # check C is prime and A + B + E == C
    if C in primes and A + B + E == C:
        count += 1
print(count)

